description:
Santanta Greatest Hits Live at Montreaux 2011
Disc 1 of 2

Film of the Santana band performing some of their most loved songs.
Still soaring 44 years after wowing the audience at Woodstock.

Recorded at the Montreaux Jazz Festival July 2nd 2011

Original DVD (English only) shrunk to burnable 4.4GB with DVD95 on Ubuntu 12.04

